import React from 'react'
import Jumbotron from "../Components/Jumbotron"
import Footer from "../Components//Footer"
import Button from "../Components/Button"

export default function Home() {
    return (
        <div>
            <Jumbotron />
            <Button />
            <Footer />
        </div>
    )
}
